    false,nt"url": null,nt"notes": "This narrative report for Seney National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1956.
    The report begins by summarizing the weather conditions, water conditions, wildfires,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, raptors, and fish-
    is also covered. The Refuge development and maintenance section discusses physical
    developments and plantings. Resource management is outlined; topics include timber
    removal. A progress report on field investigations and applied research is included.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, violations, and fishing. N-R forms are attached.",nt"owner_org":
